/* 
 * LabelRename
 *  -----------------------------------------
 * Created by Lief Esbenshade
 * Last update 10/14/2019
 *
 * This is a sisense script to relabel values for `categories` or `break by` panels in sisense. 
 * Additional values to rename should be added to newLabels.  
 * When this script is applied ANY label text that matches an entry in the newLabels array will be accordingly renamed. 
 * Because this script is variable agnostic we can't use it to remap the same value from different variables to different outcomes.
 * e.g. lep = true and iep = true cannot be changed to different things
 *
 * TODO: 
 * currently script doesn't work on category 1 variables when two catagories are used. 
 * The script is throwing 'undef label' errors when working correctly. Should clean that up.
 *
 * Notes: add 'console.log(ev.result)' into either of the `widget.on` blocks to explore the returned widget object and figure out what element to access and rename. 
*/


/* List of labels old = new */
const newLabels = {
	'detention':'Detention',
	'expulsion':'Expulsion',
	'referral':'Referral',
	'suspension':'Suspension',
	'undefined':'Undefined',
  'elective':'Elective',
  'math':'Math',
  'reading':'Reading',
  'science':'Science',
  'social_science':'Social Science'
};


/* Rename break-by */
widget.on('processresult', function (se, ev) {

	var dbLabels = ev.result.series;

	dbLabels.forEach((VALUE, index) => {

		 if (newLabels[VALUE.name] !== undefined) {
			 dbLabels[index].name = newLabels[VALUE.name];
		 } else {
			console.log('undef label');
		 }
	});
});

 const CategoryLabelRenames = {
	"major":"Major",
	 "minor":"Minor"
  };

widget.on("processresult", function (se, ev) {
    var BreakByFieldOrigName = ev.result.xAxis.categories;
    BreakByFieldOrigName.forEach((ALL_TRUE, index) => {
      if (CategoryLabelRenames[ALL_TRUE] !== undefined) {
        BreakByFieldOrigName[index] = CategoryLabelRenames[ALL_TRUE];
      } else {
        console.log("error");
      }
    });
  });




